package main

import (
    "time"
    "math"
    "runtime"

    "github.com/go-gl/gl/v2.1/gl"
    "github.com/go-gl/glfw/v3.3/glfw"
    "github.com/hortencio-main/go-sr"
)

type Vec3 struct {
    x, y, z float32
}

const (
    PI     = 3.14159                            //
    fov    = 45.0                               // field of view in degrees
    height = 200                                // framebuffer height in characters
    width  = 200                                // framebuffer width in characters
    aspect = float32(width)/float32(height)     // aspect ratio (adjusted to 5:8, for a square output on the terminal)
    near   = 0.1                                // near plane
    far    = 100.0                              // far plane
)

func init() {
    runtime.LockOSThread()
    sr.Viewport(width, height)                 // create an framebuffer for the render
    sr.PolygonMode(sr.FRONT_AND_BACK, sr.FILL) // set line drawing mode
}

func main() {
    if err := glfw.Init(); err != nil {
        panic(err)
    }
    defer glfw.Terminate()

    glfw.WindowHint(glfw.Resizable, glfw.False)
    window, err := glfw.CreateWindow(500, 500, "Software Renderer Output", nil, nil)
    if err != nil {
        panic(err)
    }
    window.MakeContextCurrent()

    if err := gl.Init(); err != nil {
        panic(err)
    }

    top    := near * float32(math.Tan(fov*PI/360.0))
    bottom := -top
    right  := top * aspect
    left   := -right

    rot := float32(0.0)

    sr.Enable (sr.LIGHTING0)
    sr.Lightfv(sr.LIGHTING0,sr.POSITION,[]float32{6, 0, 10, 0.0})
    sr.Lightfv(sr.LIGHTING0,sr.DIFFUSE, []float32{1.0, 1.0, 1.0})

    //~ sr.Enable (sr.LIGHTING1)
    //~ sr.Lightfv(sr.LIGHTING1,sr.POSITION,[]float32{-12.0, -16, -20, 0.0})
    //~ sr.Lightfv(sr.LIGHTING1,sr.DIFFUSE, []float32{0.0, 1.0, 1.0})
    
    for !window.ShouldClose() {

        rot+= 3.0
        camPos := Vec3{3, 4, 5}
        proj := sr.Frustum(left, right, bottom, top, near, far)
        view := sr.LookAt(camPos.x, camPos.y, camPos.z, 0, 0, 0)

        sr.SetCamera(proj, view)
        sr.ClearColor(0, 0, 0)
        sr.Begin()
        sr.Rotatef(rot, 0.0, 1.0, 0.1)
        sr.Translatef(0.0, -1.0, 0.0)
        for v := 0; v < len(cube); v += 4 {
            sr.Color3f (cube[v  ][3], cube[v  ][4], cube[v  ][5])
            sr.Vertex3f(cube[  v][0], cube[v  ][1], cube[v  ][2])
            sr.Vertex3f(cube[v+1][0], cube[v+1][1], cube[v+1][2])
            sr.Vertex3f(cube[v+2][0], cube[v+2][1], cube[v+2][2])
            sr.Vertex3f(cube[v+3][0], cube[v+3][1], cube[v+3][2])
        }
        sr.End()
        fb := sr.ReadPixels()
        
        // write framebuffer into a texture
        tex := make([]uint8, width*height*3)
        for y := 0; y < height; y++ {
            for x := 0; x < width; x++ {
                px := fb[x+width*y]
                i := (y*width + x) * 3
                tex[i+0] = uint8(px[0] * 255)
                tex[i+1] = uint8(px[1] * 255)
                tex[i+2] = uint8(px[2] * 255)
            }
        }

        var texture uint32
        gl.GenTextures(1, &texture)
        gl.BindTexture(gl.TEXTURE_2D, texture)
        gl.TexParameteri(gl.TEXTURE_2D, gl.TEXTURE_MIN_FILTER, gl.LINEAR)
        gl.TexParameteri(gl.TEXTURE_2D, gl.TEXTURE_MAG_FILTER, gl.LINEAR)
        gl.TexImage2D(gl.TEXTURE_2D, 0, gl.RGB, int32(width), int32(height), 0,
            gl.RGB, gl.UNSIGNED_BYTE, gl.Ptr(tex))        
        gl.Clear(gl.COLOR_BUFFER_BIT)
        gl.Enable(gl.TEXTURE_2D)
        gl.BindTexture(gl.TEXTURE_2D, texture)

        gl.Begin(gl.QUADS)
            gl.TexCoord2f(0, 1); gl.Vertex2f(-1, -1)
            gl.TexCoord2f(1, 1); gl.Vertex2f( 1, -1)
            gl.TexCoord2f(1, 0); gl.Vertex2f( 1,  1)
            gl.TexCoord2f(0, 0); gl.Vertex2f(-1,  1)
        gl.End()

        window.SwapBuffers()
        glfw.PollEvents()
        
        time.Sleep(time.Second / 60.0)
    }
}

